package com.gt.diff.webapp.bl;

import org.junit.Assert;
import org.junit.Test;

import java.util.Map;

public class Base64CompareTest {

    private static Base64Compare compare = new Base64Compare();

    @Test(expected = IllegalArgumentException.class)
    public void compareNullNull() throws Exception {
        compare.compare(null, null);
    }

    @Test(expected = IllegalArgumentException.class)
    public void compareNullRight() throws Exception {
        compare.compare("RG9vTQ==", null);
    }

    @Test(expected = IllegalArgumentException.class)
    public void compareNullLeft() throws Exception {
        compare.compare(null, "RG9vTQ==");
    }

    @Test(expected = IllegalArgumentException.class)
    public void compareEmptyLeft() throws Exception {
        compare.compare("", "RG9vTQ==");
    }

    @Test(expected = IllegalArgumentException.class)
    public void compareInvalidSize() throws Exception {
        compare.compare("A", "B");
    }

    @Test
    public void compareInvalidContent() throws Exception {
        char[] out = new char[]{0x1, 0x2, 0x3, 0x4};
        compare.compare(new String(out), "BB==");
    }

    @Test
    public void compareSameContent() throws Exception {
        Map<Integer, Integer> r = compare.compare("RG9vTQ==", "RG9vTQ==");
        Assert.assertEquals(0, r.size());
    }

    @Test
    public void compare500SameContent() throws Exception {
        Map<Integer, Integer> r = compare.compare(
                "",
                "");
        Assert.assertEquals(0, r.size());
    }

    @Test
    public void compare20ContentMismatch() throws Exception {

        String inA = "MDAwMTAyMDMwNDA1MDYwNzA4MDk="; // 00010203040506070809
        String inB = "MDAwMjA0MDYwODAxMDMwNTA3MDk="; // 00020406080103050709

        Map<Integer, Integer> r = compare.compare(inA, inB);
        Assert.assertEquals(8, r.size());
    }

    @Test
    public void compare500ContentMismatch() throws Exception {

        String inA = "";
        String inB = "";

        Map<Integer, Integer> r = compare.compare(inA, inB);
        Assert.assertEquals(501, r.size());
    }
}
